import { BACK_CARD, CARDS, LABELS, TEXT_TYPE } from "../config/variables";

class VariableService {
  getCards() {
    return CARDS;
  }
  getCardsBack() {
    return BACK_CARD;
  }
  getTextType() {
    return TEXT_TYPE;
  }
  getLabels() {
    return LABELS;
  }
}

export default new VariableService();
